section.logo-layout {
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  min-height: 200px;
  width: 100%;
}
section.logo-layout img {
  max-width: 125px;
  height: auto;
}
section.logo-layout small {
  color: #fff;
  font-size: 14px;
}

/* Start Navigation */
.nav-wrapper {
  display: flex;
  justify-content: center;
}
.nav-wrapper li {
  padding: 0 2.5rem;
}
.nav-wrapper li a {
  text-transform: uppercase;
  letter-spacing: 1px;
}
